import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import QuoteMachine from './QuoteMachine';

class App extends Component {
  render() {
    return (
      <div className="App">
       <QuoteMachine />
      </div>
    );
  }
}

export default App;
